import React, {Component} from 'react';
import Hostings from "./Hostings";
import Host2S from "./Host2s";
import Host from "./Host";

class Hosts extends Component {
    render() {
        return (
            <div>
                <Hostings/>
                <Host/>
                <Host2S/>

            </div>
        );
    }
}

export default Hosts;
